DROP TABLE IF EXISTS `w_step_def`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `w_step_def` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `head_id` int(11) NOT NULL,
  `version` int(3) NOT NULL DEFAULT '1',
  `active` bit(1) NOT NULL,
  `id_dept` int(11) DEFAULT NULL COMMENT 'departamento al que corresponde el paso',
  `id_phase` int(11) DEFAULT NULL COMMENT 'Fase con la que se asocia el paso',
  `instructions` varchar(255) DEFAULT NULL,
  `step_comments` varchar(255) DEFAULT NULL,
  `id_list_zone` varchar(100) DEFAULT NULL COMMENT 'La lista del step processor que se asocia a este paso. Default está en la tabla w_proceso',
  `id_work_zone` varchar(100) DEFAULT NULL COMMENT 'La página que contiene el trabajo a realizar del step processor.. Default está en la tabla w_proceso',
  `id_additional_zone` varchar(100) DEFAULT NULL COMMENT 'La página que contiene la información adicional para el step processor... Default está en la tabla w_proceso',
  `id_default_processor` varchar(255) DEFAULT NULL COMMENT 'xhtml procesar por defecto para este wf',
  `submit_form` varchar(255) DEFAULT NULL COMMENT 'Form que se debe submitear con el step',
  `id_time_unit` int(2) DEFAULT NULL,
  `assigned_time` int(10) unsigned DEFAULT NULL COMMENT 'CANTIDAD DE TIEMPO ASIGNADA PARA SU RESOLUCION',
  `deadline_date` date DEFAULT NULL COMMENT 'Si tiene una fecha limite',
  `deadline_time` time DEFAULT NULL COMMENT 'Si tiene una hora de resolucion limite (en la fecha indicada arriba)',
  `reminder_id_time_unit` int(2) DEFAULT NULL COMMENT 'Si hay que enviar un recordatorio, la unidad de tiempo del recordatorio',
  `reminder_time` int(11) DEFAULT NULL COMMENT 'La cantidad de tiempo antes del deadline que hay que mandar un reminder ...',
  `runtime_modifiable` bit(1) NOT NULL DEFAULT b'0' COMMENT 'se pueden cambiar parametros deadline en runtime',
  `insert_date` datetime NOT NULL,
  `insert_user` int(11) NOT NULL,
  `mod_date` datetime NOT NULL,
  `mod_user` int(11) NOT NULL,
  `sent_admin_notice` bit(1) NOT NULL DEFAULT b'0',
  `arriving_admin_notice` bit(1) NOT NULL DEFAULT b'0',
  `deadline_admin_notice` bit(1) NOT NULL DEFAULT b'0',
  `reminder_admin_notice` bit(1) NOT NULL DEFAULT b'0',
  `expired_admin_notice` bit(1) NOT NULL DEFAULT b'0',
  `email_notification` bit(1) NOT NULL DEFAULT b'0',
  `engine_notification` bit(1) NOT NULL DEFAULT b'0',
  `sent_user_notice` bit(1) NOT NULL DEFAULT b'0',
  `arriving_user_notice` bit(1) NOT NULL DEFAULT b'0',
  `deadline_user_notice` bit(1) NOT NULL DEFAULT b'0',
  `reminder_user_notice` bit(1) NOT NULL DEFAULT b'0',
  `expired_user_notice` bit(1) NOT NULL DEFAULT b'0',
  `custom_validation` bit(1) NOT NULL DEFAULT b'0' COMMENT 'Si necesita validación para continuar adelante',
  `custom_validation_ref_class` varchar(255) DEFAULT NULL COMMENT 'Clase que resuelve la validacion',
  `custom_validation_method` varchar(255) DEFAULT NULL COMMENT 'Método que resuelve la validacion. Debe devolver true o false o error de tipo ...',
  `custom_save_method` varchar(255) DEFAULT NULL COMMENT 'metodo a ejecutar en guardar() y en procesar() antes de procesar',
  `custom_save_ref_class` varchar(255) DEFAULT NULL,
  `backing_bean` bit(1) NOT NULL DEFAULT b'0',
  `shared` bit(1) NOT NULL,
  `rules` varchar(512) DEFAULT NULL,
  `preconditions` varchar(255) DEFAULT NULL,
  `postconditions` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `step_head_id` (`head_id`),
  CONSTRAINT `fk_w_step_def_1` FOREIGN KEY (`head_id`) REFERENCES `w_step_head` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=953 DEFAULT CHARSET=utf8 COMMENT='defines each step in a process';
