DROP TABLE IF EXISTS `w_step_work`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `w_step_work` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_process` int(11) NOT NULL COMMENT 'Proceso al cual corresponde el paso',
  `id_work` int(11) NOT NULL COMMENT 'Indica el id dado al work lanzado del que depende este paso',
  `sent_back` bit(1) DEFAULT b'0' COMMENT 'Indica que este paso fué devuelto',
  `id_current_step` int(11) NOT NULL COMMENT 'PASO ACTUAL DEL OBJETO',
  `id_previous_step` int(11) DEFAULT NULL COMMENT 'PASO QUE LO ENVIO AQUI',
  `arriving_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'fecha/hora a la que llego',
  `opened_date` datetime DEFAULT NULL COMMENT 'fecha hora a la que se abrio',
  `opener_user` int(11) DEFAULT NULL COMMENT 'usuario que lo abrio',
  `decided_date` datetime DEFAULT NULL COMMENT 'fecha/hora a la que se resolvio',
  `performer_user_id` int(11) DEFAULT NULL COMMENT 'ID DEL USUARIO QUE LO RESOLVIO',
  `response` varchar(20) DEFAULT NULL COMMENT 'El id de la respuesta elegida ( o aclaracion si no habian opciones / rutas )',
  `instructions` varchar(255) DEFAULT NULL COMMENT 'Instrucciones o nota para el / los siguientes pasos ( en runtime )',
  `id_time_unit` int(2) unsigned DEFAULT NULL COMMENT 'UNIDAD DE MEDIDA DE TIEMPO',
  `assigned_time` int(10) unsigned DEFAULT NULL COMMENT 'CANTIDAD DE TIEMPO ASIGNADA PARA SU RESOLUCION',
  `deadline_date` date DEFAULT NULL COMMENT 'Si tiene una fecha limite',
  `deadline_time` time DEFAULT NULL COMMENT 'Si tiene una hora de resolucion limite (en la fecha indicada arriba)',
  `reminder_id_time_unit` int(2) DEFAULT NULL COMMENT 'Si hay que enviar un recordatorio, la unidad de tiempo del recordatorio',
  `reminder_time` int(11) DEFAULT NULL COMMENT 'La cantidad de tiempo antes del deadline que hay que mandar un reminder ...',
  `admin_process` bit(1) DEFAULT b'0' COMMENT 'si lo procesa el administrador se prende a true',
  `mod_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `insert_user` int(11) NOT NULL,
  `mod_user` int(11) DEFAULT NULL,
  `locked` bit(1) NOT NULL DEFAULT b'0' COMMENT 'Si alguien quiere procesar el paso',
  `locked_by` int(11) DEFAULT NULL COMMENT 'El usuario que lo tiene bloqueado (UserId)',
  `locked_since` datetime DEFAULT NULL COMMENT 'Fecha/Hora desde la que está bloqueado',
  `user_instructions` longtext COMMENT 'Instrucciones en tiempo de ejecución dadas por un usuario ( puede ser cuando devuelve el paso )',
  `user_notes` longtext COMMENT 'Notas del propio usuario en el paso y instrucciones para el paso siguiente',
  `my_notes` bit(1) DEFAULT b'0' COMMENT 'Indica que el campo user_notes contiene notas personales',
  `send_user_notes_to_next_step` bit(1) DEFAULT b'0' COMMENT 'Indica que enviará lo escrito en las user_notes como instrucciones al próximo paso',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `fk_step_process_work` (`id_work`),
  CONSTRAINT `fk_step_process_work` FOREIGN KEY (`id_work`) REFERENCES `w_process_work` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=200 DEFAULT CHARSET=utf8 COMMENT='Tabla que lleva los pasos por donde va pasando cada work ite';
/*!40101 SET character_set_client = @saved_cs_client */;

